import React from "react";

const Contacts = ({ contacts, deleteContact }) => {
  return (
<div>
    <table >
  <tr>
    <th>Name</th>
    <th>Phone number</th>
  </tr>

  {contacts.map((contact) => {
        return (
          <tr key={contact.name}>
            <td>{contact.name}</td>
            <td>{contact.number}</td>
             <td><button onClick={() => deleteContact(contact.id)}>Delete</button></td>

          </tr>
        );
      })}


</table>

    </div>
  );
};

export default Contacts;
